// About component

import Navbar from "../components/Navbar"


const About = () => {
    <>
    <Navbar/>
      <h1>About</h1>
      <p>The mission of this website is to allow investors to track investment opportunities and provide insight into the parameters that make good optimal deals.</p>
    </>
}

export default About
